import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getPages } from "../../redux/actions/pages";

const Pages = () => {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getPages());
  });
};

export default Pages;
